import React, { useState, useEffect, useCallback } from 'react';
import './App.css';
import webSocketService from './services/WebSocketService';
import Header from './components/Header';
import Footer from './components/Footer';
import InteractionHistory from './components/InteractionHistory';
import AutonomousDrivingCard from './components/AutonomousDrivingCard';
import WeatherAlertCard from './components/WeatherAlertCard';
import ParkingUpdateCard from './components/ParkingUpdateCard';
import SafetyInspectionCard from './components/SafetyInspectionCard';
import DraggableResizeBar from './components/DraggableResizeBar';

const API_BASE = "ws://localhost:8000/api/ws";

function App() {
  const [history, setHistory] = useState([]);
  const [historyHeight, setHistoryHeight] = useState(200);
  const [autonomousDrivingData, setAutonomousDrivingData] = useState({
    start_location: '',
    end_location: '',
    passengers: 1,
  });
  const [weatherAlertData, setWeatherAlertData] = useState({
    location: '',
    alert_type: '',
    severity: 5,
  });
  const [parkingUpdateData, setParkingUpdateData] = useState({
    location: '',
    available_spots: 0,
  });
  const [safetyInspectionData, setSafetyInspectionData] = useState({
    location: '',
    require_human_intervention: false,
  });

  useEffect(() => {
    webSocketService.connect(API_BASE);

    const handleWebSocketMessage = (message) => {
      const newMessage = { ...message, id: Date.now() + Math.random(), at: new Date().toLocaleTimeString(), type: 'received' };
      setHistory(prev => [...prev, newMessage]);
    };

    webSocketService.setOnMessageHandler(handleWebSocketMessage);

    return () => {
      webSocketService.disconnect();
    };
  }, []);

  const handleSubmit = (data) => {
    const messageToSend = { ...data, id: Date.now() + Math.random(), at: new Date().toLocaleTimeString(), type: 'sent' };
    webSocketService.sendMessage(data);
    setHistory(prev => [...prev, messageToSend]);
  };

  const handleUpdate = (setter) => (e) => {
    const { name, value, type, checked } = e.target;
    setter(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleClearHistory = () => {
    setHistory([]);
  };

  const handleHeightChange = useCallback((newHeight) => {
    if (newHeight >= 100 && newHeight <= 500) {
      setHistoryHeight(newHeight);
    }
  }, []);

  return (
    <div className="App">
      <Header />
      <main className="main-content">
        <div className="cards-container">
          <AutonomousDrivingCard
            data={autonomousDrivingData}
            onUpdate={handleUpdate(setAutonomousDrivingData)}
            onSubmit={(e) => {
              e.preventDefault();
              handleSubmit(autonomousDrivingData);
            }}
          />
          <WeatherAlertCard
            data={weatherAlertData}
            onUpdate={handleUpdate(setWeatherAlertData)}
            onSubmit={(e) => {
              e.preventDefault();
              handleSubmit(weatherAlertData);
            }}
          />
          <ParkingUpdateCard
            data={parkingUpdateData}
            onUpdate={handleUpdate(setParkingUpdateData)}
            onSubmit={(e) => {
              e.preventDefault();
              handleSubmit(parkingUpdateData);
            }}
          />
          <SafetyInspectionCard
            data={safetyInspectionData}
            onUpdate={handleUpdate(setSafetyInspectionData)}
            onSubmit={(e) => {
              e.preventDefault();
              handleSubmit(safetyInspectionData);
            }}
          />
        </div>
        <div className="interaction-history-container">
          <InteractionHistory
            history={history}
            historyHeight={historyHeight}
            onClear={handleClearHistory}
          />
          <DraggableResizeBar onHeightChange={handleHeightChange} />
        </div>
      </main>
      <Footer />
    </div>
  );
}

export default App;
